    false,nt"url": null,nt"notes": "This coverage contains 49 arcs and 50 nodes
    representing power lines at Cedar Breaks National Monument. The power lines supply
    electricity and telephone services to the area. There is one main line running through
    the monument and two short spur lines supplying local buildings. These overhead
    power lines are located in areas of low visibility; in areas of higher visibility
    these utilities are served underground. These lines may supply other services as
    well. The utility poles are represented in this dataset as nodes and the utility
    lines are represented as arcs.",nt"license_title": null,nt"extras": [{ntt"key":
